    def strStr(self, haystack: str, needle: str) -> int:
        if needle == "":
            return 0
        if len(haystack) < len(needle):
            return -1    
        H = len(haystack)    
        N = len(needle)    
        for k in range(H - N + 1):
            flag = (haystack[k:k+N] == needle)
            if flag:
                return k
        return -1
                        
